     constexpr MPMCStack() = default;
--- src/mem/chunkallocator.h
@@ -79,6 +79,12 @@ namespace snmalloc
     ModArray<NUM_SLAB_SIZES, MPMCStack<ChunkRecord, RequiresInit>>
       decommitted_chunk_stack;

+    /**
