+    alignas(CACHELINE_SIZE) std::atomic<size_t> epoch{0};
+
     /**
      * All memory issued by this address space manager
      */
@@ -88,12 +94,6 @@ namespace snmalloc

     std::atomic<ChunkAllocatorLocalState*> all_local{nullptr};

